	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  111283,NULL,10489,NULL,1942,
	  "[esc 000]",20.000,NULL,"This comic book was published by the Office of War Information in mid-1942 in 12 languages: Afrikaans Arabic Chinese English French Hebrew Icelandic Persian Portuguese Spanish Swedish and Turkish. Overall print-run was 561491 copies mostly for distribution overseas. More than 51000 were printed in Portuguese 40875 were printed in Icelandic and 40130 were printed in French. Of the 31002 printed in Chinese 15200 were distributed on US soil (fifteen thousand of them were sent to the Common Counsel for American Unity an agency in New York working among alien groups the rest went to Ellis Island). The English version was called “The Life of Franklin D. Roosevelt: 32nd President of the United States of America” and had a print-run of 100035 copies which were almost all sent abroad namely distributed to US soldiers overseas. According to official records only 383 copies of the English edition originally remained in the USA 200 going to Ellis Island three to the Canadian government twenty to the College of the City of New York and the rest to the State Department and the Office of War Information itself. Among the first adventures of the OWI was dropping cakes of soap from planes on North Africa along with this comic book and a pin button with a picture of FDR painted to make him look like an Arab...",
	  NULL,NULL,NULL,NULL,NULL,NULL
